import React from "react";

function Hobbies() {
  return (
    <section>
      <h2>Hobiler ve İlgi Alanları</h2>
      <ul>
        <li>Kitap Okuma</li>
        <li>Satranç</li>
        <li>Koşu</li>
      </ul>
    </section>
  );
}

export default Hobbies;
